import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import  { faStar }  from '@fortawesome/free-regular-svg-icons';
import './Header.module.css';

const farStar = <FontAwesomeIcon icon={faStar} />




function Home() {
    return (
      <div>
        <MySlider />
        <Footer />
      </div>
    );
  }

  function Pricing() {
    return (
      <div>
        <Footer />
    </div>
    );
  }

  function Feedback() {
    return (
      <div>
        <Navtabs />
        <Rating />
        <Footer />
      </div>
    );
  }

  function Team() {
    return (
      <div>
        <MyTeam />
        <Footer />
      </div>
    );
  }

  function Signin() {
    return (
      <div>
        <LoginForm />
        <Footer />
      </div>
    );
  }
  function Signup() {
    return (
      <div>
        <RegForm />
        <Footer />
      </div>
    );
  }


const Header = () => {
	return (
		<header className="navBg">
			<div className="content-wrapper">
				<Navbar collapseOnSelect expand="sm" variant="light">    
				<Navbar.Brand href="/start-it-front" className="navLogo">
						{farStar} Star It
				</Navbar.Brand>
				<Navbar.Toggle aria-controls="responsive-navbar-nav" />
					<Navbar.Collapse id="responsive-navbar-nav">
					<Nav className="mr-auto">
							<Nav.Link href="/start-it-front/pricing">Pricing</Nav.Link>
							<Nav.Link href="/start-it-front/team">Team</Nav.Link>
							<Nav.Link href="/start-it-front/feedback">Feedback</Nav.Link>
					</Nav>
					<Nav>
							<Nav.Link href="/start-it-front/login">Sign in</Nav.Link>
							<Nav.Link href="/start-it-front/join" className="navJoin">Sign up</Nav.Link>
					</Nav>
					</Navbar.Collapse>
				</Navbar>
			</div>    
		</header>

	);
}

export default Header;
